import Vue from "vue";
import Router from "vue-router";
import App from "./pages/event.vue";
import Setting from "./pages/setting.vue";
import Login from "./pages/login.vue";
import Regestration from "./pages/regestration.vue";
import EventId from "./pages/events/_id";
import SettingId from "./pages/settings/_id";
import middleware from './middleware/router-auth'
Vue.use(Router);

export default new Router({
  mode: "history",
  routes: [
    {
      path: "/setting",
      name:"setting",
      component: Setting,
      meta: {
              middleware
          },
    },

    {
      path: "/",
      name: "App",
      component: App,  meta: {
        middleware
    },
    },
    {
      path: "/settings/:id",
      name: "settingsId",
      component: SettingId,  meta: {
        middleware
    },
    },
    {
      path: "/events/:id",
      name: "eventsId",
      component: EventId,  meta: {
        middleware
    },
    },
    {
      path: "/login",
      name: "Login",
      component: Login,
      meta: {
        layout: "auth-layout",
      },
    },
    {
      path: "/regestration",
      name: "Regestration",
      component: Regestration,
      meta: {
        layout: "auth-layout",
      },
    },
  ],
});
